A struct can refer to another struct. This is done with a SQL join. Joins are automatically added to the SQL statement in these situations: Fields in the Toql query refer to another struct through a path: user_phoneId . Fields on a joined struct are always selected: #[toql(preselect) . Fields on a joined struct are not Option<> : id: u64 . A related struct is an inner join. Example: The Toql query id translates this struct User { id: u32, name: Option<String> #[toql(sql_join(self="mobile_id" other="id"))] mobile_phone : Option<Phone> // Selectable inner join #[toql(sql_join(self="country_id" other="id"))] country : Country // Inner Join
} struct Country { id: String // Always selected
} struct Phone { id : Option<u64>, // Can be null
} into SELECT user.id, -snip-, country.id FROM User user INNER JOIN Country country ON (user.country_id = country.id) While the Toql query id, mobilePhone_id for the same structs translates into SELECT user.id, -snip-, mobile_phone.id, country.id FROM User user LEFT JOIN Phone mobile_phone ON (user.mobile_id = mobile_phone.id)
INNER JOIN Country country ON (user.country_id = country.id)

